INSERT INTO "quiz_level" VALUES(2,'Professional',2,'2013-01-27 00:42:43','2013-01-27 00:42:43');
INSERT INTO "quiz_level" VALUES(3,'Expert',3,'2013-01-27 00:42:43','2013-01-27 00:42:43');
INSERT INTO "quiz_level" VALUES(4,'Nightmare!',4,'2013-01-27 00:42:51','2013-01-27 00:42:51');
INSERT INTO "quiz_question" VALUES(1,'Which denotes the fastest time complexity?','algorithms',1,'','O(1) indicates constant time regardless of the size of the input.',1,'2013-07-28 05:32:06.185333','2013-07-28 05:32:06.185345');
INSERT INTO "quiz_question" VALUES(2,'What is the notation of quadratic time complexity?','algorithms',1,'','O(n^2) indicates quadratic time complexity, for example an algorithm that requires all input elements to be compared to all other input elements.',1,'2013-07-28 05:32:06.224732','2013-07-28 05:32:06.224744');
INSERT INTO "quiz_question" VALUES(3,'What is the average performance of the bubble sort algorithm?','algorithms',2,'','Bubble sort has worst-case and average complexity both Ðž(n2), where n is the number of items being sorted.',1,'2013-07-28 05:32:06.237451','2013-07-28 05:32:06.237462');
INSERT INTO "quiz_question" VALUES(4,'What is the average performance of the quicksort algorithm?','algorithms',2,'','On average, quicksort makes O(n log n) comparisons to sort n items.',1,'2013-07-28 05:32:06.246105','2013-07-28 05:32:06.246117');
INSERT INTO "quiz_question" VALUES(5,'Which not a stable sorting algorithm?','algorithms',2,'','Stable sorting algorithms preserve the relative order of items that compare as equal. Heapsort does not guarantee that.',1,'2013-07-28 05:32:06.254187','2013-07-28 05:32:06.254200');
INSERT INTO "quiz_question" VALUES(6,'What is not a good use case of a hash function?','algorithms',2,'','Hash functions are one-way, they cannot be applied in reverse, the input data is not recoverable from the output data, akin to lossy compression.',1,'2013-07-28 05:32:06.261692','2013-07-28 05:32:06.261704');
INSERT INTO "quiz_question" VALUES(7,'Which is not true about hash functions?','algorithms',2,'','Hash functions are heavily used in cryptography, where they are designed to be slow on purpose, to make brute force attacks more difficult.',1,'2013-07-28 05:32:06.268956','2013-07-28 05:32:06.268968');
INSERT INTO "quiz_question" VALUES(8,'Which is the oldest build tool?','build-automation',2,'','Make appeared in 1977, Ant in 2000, Maven in 2002, and CMake in 1999.',1,'2013-07-28 05:32:06.277462','2013-07-28 05:32:06.277473');
INSERT INTO "quiz_question" VALUES(9,'What is not a responsibility of an automated build system?','build-automation',2,'','Debugging is an activity that involves interacting with a running program, not part of the build process.',1,'2013-07-28 05:32:06.285091','2013-07-28 05:32:06.285103');
INSERT INTO "quiz_question" VALUES(10,'What is the common step between "./configure" and "make install" when building a software from source?','build-automation',2,'','"make" without any arguments runs the default build task, which is typically building the entire software. This step is usually after the configuration step. After this the software can be installed with "make install".',1,'2013-07-28 05:32:06.293425','2013-07-28 05:32:06.293438');
INSERT INTO "quiz_question" VALUES(11,'What is Ant?','build-automation',2,'','Ant is a build tool like make, but it is based on Java. Unlike make, it can run on any platform that has a Java Virtual Machine.',1,'2013-07-28 05:32:06.301896','2013-07-28 05:32:06.301908');
INSERT INTO "quiz_question" VALUES(12,'What is the name of the main configuration file used by make?','build-automation',2,'','The default configuration file used by make is called Makefile.',1,'2013-07-28 05:32:06.309953','2013-07-28 05:32:06.309965');
INSERT INTO "quiz_question" VALUES(13,'What is the name of the main configuration file used by Ant?','build-automation',2,'','The default configuration file used by Ant is build.xml',1,'2013-07-28 05:32:06.318685','2013-07-28 05:32:06.318697');
INSERT INTO "quiz_question" VALUES(14,'What is the name of the main configuration file used by Maven?','build-automation',2,'','The default configuration file used by Maven is pom.xml',1,'2013-07-28 05:32:06.327446','2013-07-28 05:32:06.327458');
INSERT INTO "quiz_question" VALUES(15,'How to specify that taskA depends on taskB in a Makefile?','build-automation',2,'','The correct syntax is taskA: taskB, meaning taskB will be executed first (if needed) before performing taskA.',1,'2013-07-28 05:32:06.335269','2013-07-28 05:32:06.335283');
INSERT INTO "quiz_question" VALUES(16,'In an automated build system, which is the most logical step after running unit tests?','build-automation',3,'','The software must already be compiled to run unit tests. Without a package, what is there to install or deploy?',1,'2013-07-28 05:32:06.343321','2013-07-28 05:32:06.343334');
INSERT INTO "quiz_question" VALUES(17,'What is the purpose of the "clean" step in an automated build system?','build-automation',3,'','The "clean" step typically removes build products, with the intention to start over as if the "compile" or other build steps were never executed.',1,'2013-07-28 05:32:06.352139','2013-07-28 05:32:06.352151');
INSERT INTO "quiz_question" VALUES(18,'Can you parse an HTML document using regular expressions?','computer-science',3,'','Regular expressions can only match regular languages but HTML is a context-free language. It is always possible to present a HTML file that will be matched wrongly by any regular expression.',1,'2013-07-28 05:32:06.360815','2013-07-28 05:32:06.360827');
INSERT INTO "quiz_question" VALUES(19,'What is the difference between a binary tree and a B-tree?','data-structures',2,'','A B-tree is a generalization of the binary search tree: nodes can have more than two children.',1,'2013-07-28 05:32:06.369978','2013-07-28 05:32:06.369990');
INSERT INTO "quiz_question" VALUES(20,'What is the minimum number of internal (non-leaf) nodes in a binary tree with 7 nodes?','data-structures',2,'','The minimum possible number of nodes can be achieved in a full binary tree, where every node has strictly 0 or 2 children. In this case there will be 3 internal nodes and 4 leaf nodes.',1,'2013-07-28 05:32:06.377913','2013-07-28 05:32:06.377925');
INSERT INTO "quiz_question" VALUES(21,'What is the maximum number of internal (non-leaf) nodes in a binary tree with 7 nodes?','data-structures',2,'','In a degenerate tree each parent node has only one child node, effectively behaving like a linked list data structure. In this case there will be n-1 = 6 internal nodes and 1 leaf node.',1,'2013-07-28 05:32:06.386398','2013-07-28 05:32:06.386411');
INSERT INTO "quiz_question" VALUES(22,'Which term is not like the others?','data-structures',2,'','Basically, LIFO = FILO = stack, while queue is the logical opposite.',1,'2013-07-28 05:32:06.409229','2013-07-28 05:32:06.409243');
INSERT INTO "quiz_question" VALUES(23,'Which data structure is a natural choice to implement a queue?','data-structures',2,'','A doubly linked list has O(1) insertion and deletion at both ends, so is a natural choice for queues.',1,'2013-07-28 05:32:06.418306','2013-07-28 05:32:06.418319');
INSERT INTO "quiz_question" VALUES(24,'What type of JOIN is this: SELECT * FROM t1 JOIN t2 ON t1.id = t2.id','database',2,'','When the type of the JOIN is unspecified, it is most commonly an INNER JOIN.',1,'2013-07-28 05:32:06.427416','2013-07-28 05:32:06.427428');
INSERT INTO "quiz_question" VALUES(25,'How many records will match this query if there are 5 records in Employee and 3 records in Department: SELECT * FROM Employee e LEFT JOIN Department d ON e.DepartmentID = d.DepartmentID','database',2,'','Since this is a LEFT JOIN, there will be at least one record for each employee (the left table), therefore 5 or more records.',1,'2013-07-28 05:32:06.435907','2013-07-28 05:32:06.435921');
INSERT INTO "quiz_question" VALUES(26,'How many records will match this query if there are 5 records in Employee and 3 records in Department: SELECT count(*) FROM Employee e RIGHT JOIN Department d ON e.DepartmentID = d.DepartmentID','database',2,'','Since this is a RIGHT JOIN, there will be at least one record for each department (the right table), therefore 3 or more records.',1,'2013-07-28 05:32:06.444650','2013-07-28 05:32:06.444663');
INSERT INTO "quiz_question" VALUES(27,'In SQL, which form of the count() clause might be invalid?','database',2,'','If there is no column named DepartmentID in the source tables then count(DepartmentID) will be invalid. The other forms are always valid.',1,'2013-07-28 05:32:06.452141','2013-07-28 05:32:06.452155');
INSERT INTO "quiz_question" VALUES(28,'Which SQL statement is incorrect?','database',2,'','A GROUP BY clause is required before HAVING.',1,'2013-07-28 05:32:06.461136','2013-07-28 05:32:06.461149');
INSERT INTO "quiz_question" VALUES(29,'How to find employees with DepartmentID set to NULL?','database',2,'','The correct syntax to test if something is NULL is using IS NULL.',1,'2013-07-28 05:32:06.469840','2013-07-28 05:32:06.469852');
INSERT INTO "quiz_question" VALUES(30,'What is the difference between UNION and UNION ALL in SQL?','database',2,'','Duplicate records are removed from the result of UNION, while UNION ALL returns all records.',1,'2013-07-28 05:32:06.478784','2013-07-28 05:32:06.478796');
INSERT INTO "quiz_question" VALUES(31,'What is the advantage of using a database instead of a CSV file?','database',2,'','In a database columns can be indexed, which can help finding data much faster. The other statements are not necessarily true.',1,'2013-07-28 05:32:06.487764','2013-07-28 05:32:06.487780');
INSERT INTO "quiz_question" VALUES(32,'Which database system uses the commands: lsnrctl, isqlplusctl, emctl?','database',3,'','These commands are used by Oracle to provide various services.',1,'2013-07-28 05:32:06.495870','2013-07-28 05:32:06.495883');
INSERT INTO "quiz_question" VALUES(33,'Which SQL statement might select the department with the largest number of employees?','database',3,'','The other statements either have SQL errors or incorrect.',1,'2013-07-28 05:32:06.503689','2013-07-28 05:32:06.503702');
INSERT INTO "quiz_question" VALUES(34,'How to get the current date in Oracle?','database',3,'','The function to get the current date in Oracle is SYSDATE without parentheses.',1,'2013-07-28 05:32:06.512149','2013-07-28 05:32:06.512162');
INSERT INTO "quiz_question" VALUES(35,'How to get the current date in Sybase?','database',3,'','The function to get the current date in Sybase is GETDATE().',1,'2013-07-28 05:32:06.521166','2013-07-28 05:32:06.521178');
INSERT INTO "quiz_question" VALUES(36,'Which is optional to boot an operating system?','hardware',2,'','Harddisk is not essential. An operating system can be loaded from CD or USB storage, for example. Everything else is essential (PSU is the Power Supply Unit).',1,'2013-07-28 05:32:06.588851','2013-07-28 05:32:06.588865');
INSERT INTO "quiz_question" VALUES(37,'What is the maximum amount of RAM directly addressable in a 32-bit system?','hardware',2,'','A 32-bit register can store 2^32 different values. Hence, a processor with 32-bit memory addresses can directly access 4 GiB of byte-addressable memory.',1,'2013-07-28 05:32:06.597461','2013-07-28 05:32:06.597473');
INSERT INTO "quiz_question" VALUES(38,'Which statement is false?','hardware',2,'','A 64-bit processor has backward compatibility and will handle most 32-bit software.',1,'2013-07-28 05:32:06.606007','2013-07-28 05:32:06.606020');
INSERT INTO "quiz_question" VALUES(39,'What is the difference between GPU and CPU?','hardware',2,'','GPUs have a parallel throughput architecture that emphasizes executing many concurrent threads slowly, rather than executing a single thread very quickly.',1,'2013-07-28 05:32:06.614358','2013-07-28 05:32:06.614371');
INSERT INTO "quiz_question" VALUES(40,'Which storage type has the highest theoretical transfer rate?','hardware',2,'','SSD has the highest theoretical and practical transfer rate among these choices.',1,'2013-07-28 05:32:06.623279','2013-07-28 05:32:06.623292');
INSERT INTO "quiz_question" VALUES(41,'How many disks can fail in a RAID 5 array without risk of data loss?','hardware',3,'','RAID 5 distributes parity along with the data and requires that all drives but one be present to operate. The array is not destroyed by a single drive failure. On drive failure, any subsequent reads can be calculated from the distributed parity such that the drive failure is masked from the end user.',1,'2013-07-28 05:32:06.630962','2013-07-28 05:32:06.630973');
INSERT INTO "quiz_question" VALUES(42,'Which RAID level provides the highest fault tolerance, given an array of 3 disks?','hardware',3,'','With RAID 1, n-1 disks can fail without losing data. With RAID 3 and RAID 5 only one disk can fail. RAID 0 provides no fault tolerance at all.',1,'2013-07-28 05:32:06.638725','2013-07-28 05:32:06.638736');
INSERT INTO "quiz_question" VALUES(43,'Which operating system was not derived from a version of UNIX?','history',3,'','MINIX is a UNIX-like system but it was not derived from UNIX. The others can all be traced back to some version of UNIX.',1,'2013-07-28 05:32:06.645826','2013-07-28 05:32:06.645839');
INSERT INTO "quiz_question" VALUES(44,'Which operating system was the inspiration of Linux?','history',3,'','MINIX inspired Linus Torvalds to create the Linux kernel.',1,'2013-07-28 05:32:06.654930','2013-07-28 05:32:06.654943');
INSERT INTO "quiz_question" VALUES(45,'Which is not an operating system?','os',2,'','Linux is the kernel used in the GNU/Linux operating system, not an operating system by itself.',1,'2013-07-28 05:32:06.662668','2013-07-28 05:32:06.662680');
INSERT INTO "quiz_question" VALUES(46,'In what language was UNIX originally written?','history',3,'','UNIX was originally written in assembly language, and later rewritten in C.',1,'2013-07-28 05:32:06.669949','2013-07-28 05:32:06.669962');
INSERT INTO "quiz_question" VALUES(47,'Which command will give read permission on a file for everyone?','linux',1,'','"a" means everyone, "+r" means give read permission. 444 is not correct, because it does more than just give read permission, at the same time it removes write and execute permissions.',1,'2013-07-28 05:32:06.679220','2013-07-28 05:32:06.679234');
INSERT INTO "quiz_question" VALUES(48,'Which is an example of input redirection?','linux',2,'','"<" is the input redirection operator in common shells, even in DOS.',1,'2013-07-28 05:32:06.687473','2013-07-28 05:32:06.687485');
INSERT INTO "quiz_question" VALUES(49,'If you have a guest account on a GNU/Linux system, which port can you use to setup your personal echo server?','linux',2,'','In GNU/Linux only a superuser can open ports below 1024.',1,'2013-07-28 05:32:06.694951','2013-07-28 05:32:06.694964');
INSERT INTO "quiz_question" VALUES(50,'When will this cron job run? 0 */5 * * * date','linux',2,'','The first column indicates the minute, the second column indicates the hour in a cron job definition.',1,'2013-07-28 05:32:06.702492','2013-07-28 05:32:06.702505');
INSERT INTO "quiz_question" VALUES(51,'In the bash shell, which is similar to and better than `cmd`?','linux',2,'','$(command) and `command` are the two forms of command substitution.',1,'2013-07-28 05:32:06.710848','2013-07-28 05:32:06.710861');
INSERT INTO "quiz_question" VALUES(52,'What is the file descriptor number of stderr?','os',2,'','The file descriptor number of standard error is 2.',1,'2013-07-28 05:32:06.718810','2013-07-28 05:32:06.718823');
INSERT INTO "quiz_question" VALUES(53,'Which variable controls the prompt in bash?','linux',2,'','PS1 controls the primary prompt string in bash.',1,'2013-07-28 05:32:06.726552','2013-07-28 05:32:06.726564');
INSERT INTO "quiz_question" VALUES(54,'In which column of /etc/fstab might you see /proc?','linux',3,'','/proc looks like a mount point, so it is most likely the second column.',1,'2013-07-28 05:32:06.734671','2013-07-28 05:32:06.734683');
INSERT INTO "quiz_question" VALUES(55,'Which file can restrict access to the system?','linux',2,'','The /etc/hosts.allow file can contain a list of hosts that are allowed to access the system.',1,'2013-07-28 05:32:06.742802','2013-07-28 05:32:06.742814');
INSERT INTO "quiz_question" VALUES(56,'Which file contains well known port numbers?','linux',2,'','The /etc/services file contains well known port numbers of common services, as assigned by IANA.',1,'2013-07-28 05:32:06.751179','2013-07-28 05:32:06.751192');
INSERT INTO "quiz_question" VALUES(57,'Which command will assign permissions rwxr-x--- to a file?','linux',2,'','chmod 750 gives all permissions to the owner (4 + 2 + 1), read and execute permission to the group (4 + 1), and no permissions for others (0).',1,'2013-07-28 05:32:06.760211','2013-07-28 05:32:06.760225');
INSERT INTO "quiz_question" VALUES(58,'Which command will produce different output?','linux',3,'','The perl command does not read standard input, therefore it cannot match the string "tmp" like the other commands.',1,'2013-07-28 05:32:06.768756','2013-07-28 05:32:06.768770');
INSERT INTO "quiz_question" VALUES(59,'Which command will create a backup of /opt/apache/ directory?','linux',3,'','The "c" specifies that we want to create an archive, the "f" followed by a filename is the destination, the -C followed by a directory to change to, the "apache" in the end is the name of the file/directory to backup. The other choices are incorrect.',1,'2013-07-28 05:32:06.777174','2013-07-28 05:32:06.777189');
INSERT INTO "quiz_question" VALUES(60,'Which was the earliest GNU/Linux distribution?','linux',2,'','Knoppix, Ubuntu, Mint are all derivatives of Debian.',1,'2013-07-28 05:32:06.785067','2013-07-28 05:32:06.785078');
INSERT INTO "quiz_question" VALUES(61,'Which command is used to configure a firewall?','linux',3,'','iptables is an administration tool for IPv4 packet filtering and NAT, a common firewall software in GNU/Linux.',1,'2013-07-28 05:32:06.793924','2013-07-28 05:32:06.793940');
INSERT INTO "quiz_question" VALUES(62,'Which environment variable is usually not a path?','linux',3,'','LOGNAME is usually the username of the current user, not a path.',1,'2013-07-28 05:32:06.802038','2013-07-28 05:32:06.802052');
INSERT INTO "quiz_question" VALUES(63,'Which file controls the number of available virtual terminals in GNU/Linux?','linux',3,'','The virtual terminals are configured in the /etc/inittab file.',1,'2013-07-28 05:32:06.810181','2013-07-28 05:32:06.810193');
INSERT INTO "quiz_question" VALUES(64,'What is usually not stored in /etc/passwd?','linux',2,'','The password is usually stored in /etc/shadow, with more strict access permissions.',1,'2013-07-28 05:32:06.818340','2013-07-28 05:32:06.818353');
INSERT INTO "quiz_question" VALUES(65,'In GNU/Linux, which runlevel is a multi-user runlevel?','linux',3,'','Runlevels 2 to 5 are multi-user runlevels.',1,'2013-07-28 05:32:06.827522','2013-07-28 05:32:06.827534');
INSERT INTO "quiz_question" VALUES(66,'In GNU/Linux, what is the name of the process with PID 1?','linux',3,'','In GNU/Linux the "init" process is the parent of all processes, it gets the first PID which is 1.',1,'2013-07-28 05:32:06.835679','2013-07-28 05:32:06.835692');
INSERT INTO "quiz_question" VALUES(67,'Which signal cannot be trapped?','linux',3,'','The KILL signal is non-catchable, non-ignorable, immediately kills a process without possibility of cleaning up.',1,'2013-07-28 05:32:06.843492','2013-07-28 05:32:06.843508');
INSERT INTO "quiz_question" VALUES(68,'What is the purpose of the PAGER variable in UNIX?','linux',3,'','The PAGER variable can be used to override the default program used to view man pages.',1,'2013-07-28 05:32:06.851851','2013-07-28 05:32:06.851866');
INSERT INTO "quiz_question" VALUES(69,'Which command cannot list the files in a directory?','linux',3,'','The dirs command shows the list of remembered directories (stored by the pushd command), it cannot be used to list the files in a directory.',1,'2013-07-28 05:32:06.861313','2013-07-28 05:32:06.861325');
INSERT INTO "quiz_question" VALUES(70,'Which command cannot send an email in GNU/Linux?','linux',3,'','groff is a document formatting system (for example rendering man pages) and cannot be used to send emails. Yes you can send an email with telnet, though it won''t be pretty.',1,'2013-07-28 05:32:06.868897','2013-07-28 05:32:06.868911');
INSERT INTO "quiz_question" VALUES(71,'Which command check if a given PID is running or not?','linux',3,'','The top command shows only a subset of all processes, it might not include the PID you''re looking for. You can use kill -0 PID to check any PID, but of course ps -p is the ideal choice.',1,'2013-07-28 05:32:06.876792','2013-07-28 05:32:06.876807');
INSERT INTO "quiz_question" VALUES(72,'Mac OS X is based on which operating system?','mac',2,'','OS X, previously Mac OS X, is based on the NeXTSTEP operating system, which incorporates certain parts from FreeBSD''s and NetBSD''s implementation of UNIX.',1,'2013-07-28 05:32:06.884943','2013-07-28 05:32:06.884956');
INSERT INTO "quiz_question" VALUES(73,'The kernel of Mac OS X is based on which kernel?','mac',2,'','Mach is an operating system kernel developed at Carnegie Mellon University to support operating system research, primarily distributed and parallel computation.',1,'2013-07-28 05:32:06.894103','2013-07-28 05:32:06.894116');
INSERT INTO "quiz_question" VALUES(74,'Which is not a version of Mac OS X?','mac',2,'','There was no Mac OS X version with codename Kitten, the codename of version 10.1 was Puma.',1,'2013-07-28 05:32:06.901805','2013-07-28 05:32:06.901818');
INSERT INTO "quiz_question" VALUES(75,'Which utility is not installed by default on a Mac OS X?','mac',2,'','Mac OS X uses mostly BSD implementation of common UNIX tools, as opposed to GNU implementation. Gawk is the GNU implementation of the AWK programming language.',1,'2013-07-28 05:32:06.909770','2013-07-28 05:32:06.909785');
INSERT INTO "quiz_question" VALUES(76,'What does the "X" stand for in Mac OS X?','mac',2,'','The X stands for the roman letter, meaning 10. Its predecessor was Mac OS 9.',1,'2013-07-28 05:32:06.933186','2013-07-28 05:32:06.933198');
INSERT INTO "quiz_question" VALUES(77,'What is the common port number of an FTP server?','network',2,'','The common port of an FTP server is 21.',1,'2013-07-28 05:32:06.940677','2013-07-28 05:32:06.940688');
INSERT INTO "quiz_question" VALUES(78,'Which is not one of the default chains of an iptables firewall?','network',2,'','ACCEPT is not a chain, but a rule. The others are typical chains.',1,'2013-07-28 05:32:06.948520','2013-07-28 05:32:06.948534');
INSERT INTO "quiz_question" VALUES(79,'Which file might contain such line: nameserver 192.168.1.1','network',2,'','The /etc/resolv.conf file is used to provide various information to DNS resolver.',1,'2013-07-28 05:32:06.957101','2013-07-28 05:32:06.957114');
INSERT INTO "quiz_question" VALUES(80,'Which is not essential for connecting to another computer on the same LAN?','network',2,'','It is not possible to connect to another computer without configuring a network interface with an IP address and correct netmask, and a route between the computers. A name server is optional.',1,'2013-07-28 05:32:06.967017','2013-07-28 05:32:06.967028');
INSERT INTO "quiz_question" VALUES(81,'How to find the default gateway?','network',2,'','The route command prints all the routes, including the default gateway.',1,'2013-07-28 05:32:06.975232','2013-07-28 05:32:06.975243');
INSERT INTO "quiz_question" VALUES(82,'How to check if port 1234 is listening for incoming connections?','network',2,'','telnet is useful to check if a port is open. Another easy way is using netstat, but not with the -p flag.',1,'2013-07-28 05:32:06.984212','2013-07-28 05:32:06.984225');
INSERT INTO "quiz_question" VALUES(83,'Which does not necessarily cause the failure of: ping google.com','network',2,'','Being on a NAT does not necessarily prevent access to the outside. The other factors would necessarily prevent pinging google.com',1,'2013-07-28 05:32:06.994385','2013-07-28 05:32:06.994400');
INSERT INTO "quiz_question" VALUES(84,'How to declare a pointer to an integer in C?','programming',1,'','In the C language you declare pointers using *, which is called the value-at-address operator or indirection operator.',1,'2013-07-28 05:32:07.002468','2013-07-28 05:32:07.002480');
INSERT INTO "quiz_question" VALUES(85,'What will be the value of i when executing int i = 10 / 3','programming',1,'','Since i is integer, the decimal part of the computation will be simply ignored.',1,'2013-07-28 05:32:07.011421','2013-07-28 05:32:07.011437');
INSERT INTO "quiz_question" VALUES(86,'When would you use a LinkedList instead of an ArrayList?','programming',2,'','In a linked list, elements are chained together: each element has a pointer to the next. Insert and remove operations are more memory-efficient compared to an ArrayList, at the cost that random access of elements is less efficient.',1,'2013-07-28 05:32:07.019344','2013-07-28 05:32:07.019361');
INSERT INTO "quiz_question" VALUES(87,'What is the advantage of using an ArrayList instead of a LinkedList?','programming',2,'','Elements in an ArrayList can be accessed directly by a numeric index, but in a LinkedList you must travers the elements from the start or the end until the desired element.',1,'2013-07-28 05:32:07.028213','2013-07-28 05:32:07.028227');
INSERT INTO "quiz_question" VALUES(88,'What is CORBA for?','programming',2,'','The Common Object Request Broker Architecture (CORBA) enables software components written in multiple computer languages and running on multiple computers to work together.',1,'2013-07-28 05:32:07.036338','2013-07-28 05:32:07.036350');
INSERT INTO "quiz_question" VALUES(89,'What is the purpose of a CRC function?','programming',2,'','A cyclic redundancy check (CRC) is an error-detecting code commonly used in digital networks and storage devices to detect accidental changes to raw data.',1,'2013-07-28 05:32:07.045064','2013-07-28 05:32:07.045077');
INSERT INTO "quiz_question" VALUES(90,'How to declare the main method of a C program?','programming',2,'','The main method should return integer, and the arguments should give the number and values of the program''s command-line arguments.',1,'2013-07-28 05:32:07.054328','2013-07-28 05:32:07.054340');
INSERT INTO "quiz_question" VALUES(91,'Which regular expression will not match "foobar"?','programming',2,'','The "." matches any character, but since there is nothing between "foo" and "bar", this won''t match.',1,'2013-07-28 05:32:07.062420','2013-07-28 05:32:07.062433');
INSERT INTO "quiz_question" VALUES(92,'Which regular expression will match a word that starts with "foo" and has at least 4 letters?','programming',2,'','The "\<" indicates the start of a word, and "\w+" indicates one or more word characters. The other choices are not restrictive enough, and may match input that doesn''t meet the criteria.',1,'2013-07-28 05:32:07.070132','2013-07-28 05:32:07.070145');
INSERT INTO "quiz_question" VALUES(93,'How to match an empty line using regular expressions?','programming',2,'','The "^" indicates the beginning of the line, and the "$" indicates the end of the line. Thus, if the beginning of the line is followed directly by the end of the line, that must be an empty line.',1,'2013-07-28 05:32:07.079055','2013-07-28 05:32:07.079067');
INSERT INTO "quiz_question" VALUES(94,'If i=3 and j=i++, what is the value of j?','programming',2,'','In j=i++ the value of i will be first copied to j before i is incremented.',1,'2013-07-28 05:32:07.087216','2013-07-28 05:32:07.087402');
INSERT INTO "quiz_question" VALUES(95,'What will be the value of f when executing float f = 5 / 2 / .5; in the C language?','programming',2,'','The first division will be treated as an operation on integers, resulting in 2, which divided by 0.5 will result in 4.',1,'2013-07-28 05:32:07.095674','2013-07-28 05:32:07.095686');
INSERT INTO "quiz_question" VALUES(96,'What will be the value of f when executing float f = 5 / 2. / .5; in the C language?','programming',2,'','In the first division, "2." will be treated as a float, and the result of the division will be 2.5, which then divided by 0.5 will result in 5.',1,'2013-07-28 05:32:07.103645','2013-07-28 05:32:07.103658');
INSERT INTO "quiz_question" VALUES(97,'In C, given char **argv, what is equivalent to printf("%s\n", argv[0])','programming',3,'','argv + n is the address of the n-th element in the array. The * operator dereferences the pointer, obtaining the value stored at the pointed location.',1,'2013-07-28 05:32:07.112611','2013-07-28 05:32:07.112624');
INSERT INTO "quiz_question" VALUES(98,'Which regular expression is a zero-width positive look-behind assertion?','programming',3,'','Usually, "<" indicates a look-behind assertion, and "!" indicates a negative assertion.',1,'2013-07-28 05:32:07.120600','2013-07-28 05:32:07.120613');
INSERT INTO "quiz_question" VALUES(99,'Which is not in the same group as LISP?','programming',3,'','LISP, R, Scheme, and Scala are all functional languages. C++ is an imperative language.',1,'2013-07-28 05:32:07.129466','2013-07-28 05:32:07.129479');
INSERT INTO "quiz_question" VALUES(100,'Which is not in the same group as C++?','programming',3,'','C++, C, Java, and MATLAB, are all imperative languages. Haskell is a functional language.',1,'2013-07-28 05:32:07.137816','2013-07-28 05:32:07.137829');
INSERT INTO "quiz_question" VALUES(101,'What is the most likely to cause a stack overflow?','programming',3,'','A common cause of a stack overflow is very deep or infinite recursion, exhausting the address space of the call stack. A common solution is to improve the algorithm to reduce the depth of recursions.',1,'2013-07-28 05:32:07.148390','2013-07-28 05:32:07.148403');
INSERT INTO "quiz_question" VALUES(102,'What is wrong with static methods?','programming',3,'','Code calling static methods is hard to test because you cannot mock the static calls. Static methods in themselves are not hard to test. The other statements are true of static methods but don''t constitute a "problem".',1,'2013-07-28 05:32:07.161651','2013-07-28 05:32:07.161663');
INSERT INTO "quiz_question" VALUES(103,'What kind of regular expression is this: (?=pattern)','programming',3,'','This is zero-width positive look-ahead assertion. For example /\w+(?=\t)/ matches a word followed by a tab.',1,'2013-07-28 05:32:07.170720','2013-07-28 05:32:07.170732');
INSERT INTO "quiz_question" VALUES(104,'How to convert all characters in a file to lowercase?','scripting',2,'','tr reads text from standard input and writes to standard output. It does not take filenames as input or output arguments.',1,'2013-07-28 05:32:07.178865','2013-07-28 05:32:07.178877');
INSERT INTO "quiz_question" VALUES(105,'How to append .bak extension to all files in a directory and all its sub-directories?','scripting',2,'','The -exec flag of the find command should end either with \; or +. With + the command will be executed only once with all files as arguments. With \; the command will be executed once for each file.',1,'2013-07-28 05:32:07.188042','2013-07-28 05:32:07.188054');
INSERT INTO "quiz_question" VALUES(106,'In which scripting language is this a valid statement: cmd=/bin/cat.exe','scripting',2,'','This is a valid statement to assign the value "/bin/cat.exe" to the variable "cmd" in bash. The statement is not valid in the other languages.',1,'2013-07-28 05:32:07.197328','2013-07-28 05:32:07.197340');
INSERT INTO "quiz_question" VALUES(107,'The bash shell reads which file first on startup?','scripting',2,'','When run without special options, bash reads /etc/profile first.',1,'2013-07-28 05:32:07.205877','2013-07-28 05:32:07.205890');
INSERT INTO "quiz_question" VALUES(108,'How many lines will be printed by this: echo 1 && echo 2 || echo 3','scripting',2,'','2 lines: "echo 1" succeeds, therefore "echo 2" is executed, and since that succeeds, "echo 3" is not executed at all.',1,'2013-07-28 05:32:07.214844','2013-07-28 05:32:07.214857');
INSERT INTO "quiz_question" VALUES(109,'How many lines will be printed by this: seq 9 | paste - - -','scripting',2,'','seq 9 will print the numbers 1 to 9, each on a separate line, and paste will organize them to 3 columns, resulting in 3 total lines in the output, starting with 1 2 3 on the first line, and so on.',1,'2013-07-28 05:32:07.223856','2013-07-28 05:32:07.223871');
INSERT INTO "quiz_question" VALUES(110,'What will be the output of this: echo hello | grep hi && echo one || echo two','scripting',2,'','The grep will not match anything, which is a failure, therefore echo two will be executed.',1,'2013-07-28 05:32:07.244766','2013-07-28 05:32:07.244778');
INSERT INTO "quiz_question" VALUES(111,'How to redirect both stdout and stderr of a command to the same file?','scripting',3,'','One way to achive this is to first redirect stdout and then redirect stderr to whatever stdout is pointing to.',1,'2013-07-28 05:32:07.261856','2013-07-28 05:32:07.261868');
INSERT INTO "quiz_question" VALUES(112,'Which is the least unsafe?','security',2,'','Only the strncpy function checks bounds, the others don''t. Not checking bounds is very likely to lead to buffer overflow defects.',1,'2013-07-28 05:32:07.270725','2013-07-28 05:32:07.270736');
INSERT INTO "quiz_question" VALUES(113,'Which is the most secure method to protect access to a website?','security',2,'','Public key authentication is usually implemented with HTTPS / SSL client certificates, and it is much safer than the other methods, where the password can be either sniffed or the authentication token replayed.',1,'2013-07-28 05:32:07.278724','2013-07-28 05:32:07.278740');
INSERT INTO "quiz_question" VALUES(114,'Which kind of attack on computer security is a form of active eavesdropping (secretly listening)?','security',2,'','The attacker makes independent connections with the victims and relays messages between them, making them believe that they are talking directly to each other over a private connection, when in fact the entire conversation is controlled by the attacker.',1,'2013-07-28 05:32:07.289050','2013-07-28 05:32:07.289062');
INSERT INTO "quiz_question" VALUES(115,'What is the recommended permission setting on a user''s ~/.ssh/authorized_keys file?','security',2,'','Only the owner of the file should have any kind of access.',1,'2013-07-28 05:32:07.298771','2013-07-28 05:32:07.298783');
INSERT INTO "quiz_question" VALUES(116,'Which service should be removed to harden the security of a system?','security',2,'','File transfers via FTP are not encrypted, therefore they can be captured by anyone on the same network using a packet sniffereasily revealing login usernames and passwords. Windows is not a "service", it''s an operating system.',1,'2013-07-28 05:32:07.306575','2013-07-28 05:32:07.306588');
INSERT INTO "quiz_question" VALUES(117,'Which open port signals a potential security risk in a UNIX-like system?','security',2,'','Port 23 is the default port of Telnet, an obsolete, insecure login service. The other ports correspond to more secure services protected by encryption.',1,'2013-07-28 05:32:07.314489','2013-07-28 05:32:07.314502');
INSERT INTO "quiz_question" VALUES(118,'What is the weakest point in the computer security of a typical large firm?','security',3,'','The typical weakest point is the employees, as social engineering and human gallibility can often circumvent otherwise state of the art computer security system.',1,'2013-07-28 05:32:07.322782','2013-07-28 05:32:07.322795');
INSERT INTO "quiz_question" VALUES(119,'Which is the most dangerous security probing tool?','security',3,'','nmap is a sophisticated port scanner, and can reveal much more about a network than all the other tools combined.',1,'2013-07-28 05:32:07.332054','2013-07-28 05:32:07.332066');
INSERT INTO "quiz_question" VALUES(120,'Which is the worst method for encrypting data?','security',3,'','sha1 is not an encryption method but a message digest method.',1,'2013-07-28 05:32:07.339872','2013-07-28 05:32:07.339884');
INSERT INTO "quiz_question" VALUES(121,'Which tool is not suitable to encrypt files?','security',3,'','encfs and TrueCrypt can be used to create encrypted directories, and openssl can be used to encrypt a stream of data. nmap is a network scanning tool, not for encryption.',1,'2013-07-28 05:32:07.347957','2013-07-28 05:32:07.347982');
INSERT INTO "quiz_question" VALUES(122,'Which tool is not suitable to find open ports on the local system?','security',3,'','ping can only send ICMP ECHO requests to hosts, it cannot be used to find open ports.',1,'2013-07-28 05:32:07.355475','2013-07-28 05:32:07.355487');
INSERT INTO "quiz_question" VALUES(123,'Which tool is not suitable to find open ports on a remote system?','security',3,'','Unlike the others, netstat cannot be used to scan arbitrary remote ports.',1,'2013-07-28 05:32:07.363598','2013-07-28 05:32:07.363612');
INSERT INTO "quiz_question" VALUES(124,'What''s the worst thing that can happen if you configure nmap with suid root?','security',3,'','Privilege escalation could be used to create all the other damages. Except maybe releasing the kraken. Not sure.',1,'2013-07-28 05:32:07.371487','2013-07-28 05:32:07.371499');
INSERT INTO "quiz_question" VALUES(125,'What''s the scariest defect that can happen in a web application?','security',3,'','A buffer overflow can potentially lead to privilege escalation, which could be used to produce all the others and much worse.',1,'2013-07-28 05:32:07.378882','2013-07-28 05:32:07.378894');
INSERT INTO "quiz_question" VALUES(126,'Which kind of protocol would be the most efficient to implement low-latency communication between remote processes?','software-engineering',2,'','A binary protocol yields the smallest possible footprint in the communication, which is often a significant boost compared to more verbose text-based protocols like SOAP or XML.',1,'2013-07-28 05:32:07.388275','2013-07-28 05:32:07.388287');
INSERT INTO "quiz_question" VALUES(127,'What is the decimal value of 0x15?','system-programming',1,'','0x15 is a hexadecimal notation, its decimal value is calculated like this: 1 * 16^1 + 5 * 16^0 = 1 * 16 + 5 * 1 = 16 + 5 = 21',1,'2013-07-28 05:32:07.397352','2013-07-28 05:32:07.397365');
INSERT INTO "quiz_question" VALUES(128,'What is the decimal value of 015?','system-programming',1,'','015 is an octal notation, its decimal value is calculated like this: 1 * 8^1 + 5 * 8^0 = 1 * 8 + 5 * 1 = 8 + 5 = 13',1,'2013-07-28 05:32:07.404933','2013-07-28 05:32:07.404945');
INSERT INTO "quiz_question" VALUES(129,'What is the decimal value of 0b1101?','system-programming',1,'','0b1101 is a binary notation, its decimal value is calculated like this: 1 * 2^3 + 1 * 2^2 + 0 * 2^1 + 1 * 2^0 = 8 + 4 + 1 = 13',1,'2013-07-28 05:32:07.413359','2013-07-28 05:32:07.413375');
INSERT INTO "quiz_question" VALUES(130,'How to write the number 11 in binary notation?','system-programming',1,'','The value of the binary expression 0b1011 = 2^3 + 2^1 + 2^0 = 8 + 2 + 1 = 11',1,'2013-07-28 05:32:07.421431','2013-07-28 05:32:07.421443');
INSERT INTO "quiz_question" VALUES(131,'Which is a low-level system programming language?','system-programming',1,'','Assembly is a low level language, designed for writing system software as distinct from application software.',1,'2013-07-28 05:32:07.428832','2013-07-28 05:32:07.428847');
INSERT INTO "quiz_question" VALUES(132,'What is endianness about?','system-programming',2,'','Endian and endianness in the most common cases refers to how bytes are ordered.',1,'2013-07-28 05:32:07.438394','2013-07-28 05:32:07.438405');
INSERT INTO "quiz_question" VALUES(133,'Which is not a system call?','system-programming',2,'','printf calls the write system call to print text on standard output.',1,'2013-07-28 05:32:07.447966','2013-07-28 05:32:07.447978');
INSERT INTO "quiz_question" VALUES(134,'What is 0x15 + 0x17?','system-programming',2,'','0x15 is 16 + 5 = 21 and 0x17 is 16 + 7 = 23, so 21 + 23 = 44',1,'2013-07-28 05:32:07.455720','2013-07-28 05:32:07.455732');
INSERT INTO "quiz_question" VALUES(135,'What is 0x15 & 0x17?','system-programming',2,'','0x15 is 10101 and 0x17 is 10111, so 10101 & 10111 = 10101 = 21',1,'2013-07-28 05:32:07.464052','2013-07-28 05:32:07.464066');
INSERT INTO "quiz_question" VALUES(136,'How to represent -15 using 8-bit two''s complement?','system-programming',2,'','The 8-bit two''s complement of a number can be calculated by subtracting the unsigned number from 256, in this case 256 - 15 = 241 = 0b11110001',1,'2013-07-28 05:32:07.472820','2013-07-28 05:32:07.472832');
INSERT INTO "quiz_question" VALUES(137,'Which is not a programming language?','system-programming',3,'','CGI stands for Common Gateway Interface, a standard for dynamic generation of web pages by a web server. It is not a programming language.',1,'2013-07-28 05:32:07.482030','2013-07-28 05:32:07.482042');
INSERT INTO "quiz_question" VALUES(138,'How to check the owner of a domain name?','tools',1,'','The whois command looks up records in the database maintained by several Network Information Centers (NICs).',1,'2013-07-28 05:32:07.489610','2013-07-28 05:32:07.489622');
INSERT INTO "quiz_question" VALUES(139,'Which compression tool cannot work as a filter?','tools',2,'','7zip has a very compression ratio but it cannot be used a filter.',1,'2013-07-28 05:32:07.498979','2013-07-28 05:32:07.498992');
INSERT INTO "quiz_question" VALUES(140,'How to print the 3rd and 5th columns of a csv file?','tools',2,'','The -f flag is used to specify the columns, which can be a comma separated list. The -d flag is used to specify the delimiter of the columns.',1,'2013-07-28 05:32:07.506829','2013-07-28 05:32:07.506840');
INSERT INTO "quiz_question" VALUES(141,'How to check if a web server is running?','tools',2,'','One way to check if a web server is running is to send a GET request to it using telnet, for example by sending the text "GET /".',1,'2013-07-28 05:32:07.516381','2013-07-28 05:32:07.516393');
INSERT INTO "quiz_question" VALUES(142,'Which filesystem does not use journaling?','tools',2,'','ext2 is an old filesystem introduced in 1993, it did not use a journal. It has been supplanted by ext3, which is almost completely compatible with ext2 and is a journaling file system.',1,'2013-07-28 05:32:07.524683','2013-07-28 05:32:07.524695');
INSERT INTO "quiz_question" VALUES(143,'How to check if the network interface is correctly configured in GNU/Linux?','tools',2,'','The ifconfig command shows the configuration of network interfaces, including such details as IP address, netmask, broadcast address and MAC address.',1,'2013-07-28 05:32:07.533282','2013-07-28 05:32:07.533293');
INSERT INTO "quiz_question" VALUES(144,'How to permit incoming connections to the web server?','tools',2,'','-A INPUT is required to indicate incoming connections, --dport 80 is required to match destination port 80, -j ACCEPT is required to permit the connection.',1,'2013-07-28 05:32:07.541251','2013-07-28 05:32:07.541264');
INSERT INTO "quiz_question" VALUES(145,'How to list the currently mounted file systems?','tools',2,'','The mount command with no parameters shows the currently mounted file systems.',1,'2013-07-28 05:32:07.550886','2013-07-28 05:32:07.550898');
INSERT INTO "quiz_question" VALUES(146,'Which tool is most useful for load testing a web server?','tools',2,'','ab is the Apache HTTP server benchmarking tool, but it is useful to perform load testing on any web server.',1,'2013-07-28 05:32:07.559825','2013-07-28 05:32:07.560139');
INSERT INTO "quiz_question" VALUES(147,'Which is not a web server software?','tools',3,'','X server is the server counterpart of the X Window System in UNIX, and has nothing to do with web servers.',1,'2013-07-28 05:32:07.568716','2013-07-28 05:32:07.568728');
INSERT INTO "quiz_question" VALUES(148,'Which is not a network analysis tool?','tools',3,'','tcpdump dumps traffic on a network; wireshark is a network traffic analyzer; nmap is a network security auditing tool; that leaves us with screen, which is a terminal multiplexer tool.',1,'2013-07-28 05:32:07.577300','2013-07-28 05:32:07.577315');
INSERT INTO "quiz_question" VALUES(149,'What is the purpose of the -h flag of the ls command in UNIX?','tools',3,'','When used together with the -l flag for long format, the -h makes the ls command print file sizes in human readable format like 1K, 234M, 2G.',1,'2013-07-28 05:32:07.585450','2013-07-28 05:32:07.585462');
INSERT INTO "quiz_question" VALUES(150,'How to print the 2nd and 1st columns of a csv file, in that order?','tools',3,'','The awk solution works, by setting the input and output field separators to a comma, and printing the selected columns in the desired order.',1,'2013-07-28 05:32:07.593664','2013-07-28 05:32:07.593677');
INSERT INTO "quiz_question" VALUES(151,'Which is not a Version Control System?','version-control',2,'','CSV stands for Comma Separated Values, it is a common file format, not a Version Control System.',1,'2013-07-28 05:32:07.601805','2013-07-28 05:32:07.601817');
INSERT INTO "quiz_question" VALUES(152,'Which version control operation will never result in a conflict?','version-control',2,'','The update, merge and rebase operations all involve some sort of merging, and may result in conflicts. The add operation can never result in a conflict.',1,'2013-07-28 05:32:07.610622','2013-07-28 05:32:07.610653');
INSERT INTO "quiz_question" VALUES(153,'Which version control operation may rewrite the history?','version-control',2,'','The rebase operation rewrites the history of a branch by replaying a set of changes on top another branch.',1,'2013-07-28 05:32:07.619068','2013-07-28 05:32:07.619080');
INSERT INTO "quiz_question" VALUES(154,'In version control, what is the term for merging another branch that is not diverged but some versions ahead of the current branch?','version-control',3,'','In this situation the current branch HEAD can be simply fast-forwarded to the same position as the other branch HEAD, hence the name.',1,'2013-07-28 05:32:07.627548','2013-07-28 05:32:07.627563');
INSERT INTO "quiz_question" VALUES(155,'In version control, which is the least scalable workflow?','version-control',3,'','The central server can become a bottleneck. The other workflows can be scaled by replicating them on multiple layers.',1,'2013-07-28 05:32:07.636478','2013-07-28 05:32:07.636493');
INSERT INTO "quiz_question" VALUES(156,'Which is a Distributed Version Control System?','version-control',3,'','These are all version control systems, but only Mercurial has a distributed model, the others use a client-server model.',1,'2013-07-28 05:32:07.644258','2013-07-28 05:32:07.644270');
INSERT INTO "quiz_question" VALUES(157,'Which version control operation requires access to the server in a centralized VCS?','version-control',2,'','In a centralized VCS all operations that involve the history need to access the repository on the central server. The status, add, and mv commands can be performed without access to the server.',1,'2013-07-28 05:32:07.653213','2013-07-28 05:32:07.653228');
INSERT INTO "quiz_question" VALUES(158,'What can be a disadvantage of a distributed VCS compared to a centralized VCS?','version-control',3,'','In a distributed VCS, initial cloning is typically slower, as the tool must download the entire project history. The other choices are disadvantages of centralized VCS.',1,'2013-07-28 05:32:07.661437','2013-07-28 05:32:07.661498');
INSERT INTO "quiz_question" VALUES(159,'In a version control system, which type of conflict can have an automatic resolution when merging branchA into branchB?','version-control',3,'','If branchA and branchB edited completely different parts of the file, that should be possible to resolve automatically. The other types of conflict require an explicit decision and action by a human.',1,'2013-07-28 05:32:07.670287','2013-07-28 05:32:07.670299');
INSERT INTO "quiz_question" VALUES(160,'In web programming, what is the QUERY_STRING?','web-programming',2,'','The QUERY_STRING is the part of a URL after the question mark, not including the question mark itself, for example "search=hello&page=2".',1,'2013-07-28 05:32:07.678733','2013-07-28 05:32:07.678746');
INSERT INTO "quiz_question" VALUES(161,'What is the status code of a successful HTTP request?','web-programming',2,'','"200 OK" is the standard response for successful HTTP requests.',1,'2013-07-28 05:32:07.688089','2013-07-28 05:32:07.688101');
INSERT INTO "quiz_question" VALUES(162,'What does CGI stand for in web programming?','web-programming',2,'','Common Gateway Interface, a standard for dynamic generation of web pages by a web server.',1,'2013-07-28 05:32:07.696790','2013-07-28 05:32:07.696803');
INSERT INTO "quiz_question" VALUES(163,'In web programming, where are cookies stored?','web-programming',2,'','Cookies are stored on the client side and sent to the server until expired',1,'2013-07-28 05:32:07.705508','2013-07-28 05:32:07.705521');
INSERT INTO "quiz_question" VALUES(164,'Which is not a standard attribute of HTTP cookie parameters?','web-programming',2,'','Standard parameters of HTTP cookies are: Expires, Domain, Path, HttpOnly, Secure. Date is not one of them.',1,'2013-07-28 05:32:07.714039','2013-07-28 05:32:07.714052');
INSERT INTO "quiz_question" VALUES(165,'What marks the end of an HTTP header?','web-programming',2,'','The end of the header fields is indicated by an empty field, resulting in the transmission of two consecutive CR-LF pairs.',1,'2013-07-28 05:32:07.721730','2013-07-28 05:32:07.721744');
INSERT INTO "quiz_question" VALUES(166,'Which is not a common CGI environment variable?','web-programming',3,'','HTTP_USER_AGENT is the browser type of the visitor, HTTP_REFERER is the URL of the page that called the current one, and DOCUMENT_ROOT is the root directory of the server.',1,'2013-07-28 05:32:07.730455','2013-07-28 05:32:07.730467');
INSERT INTO "quiz_question" VALUES(167,'Which is a common CGI environment variable?','web-programming',3,'','REMOTE_ADDR is the IP address of the visitor.',1,'2013-07-28 05:32:07.738725','2013-07-28 05:32:07.738737');
INSERT INTO "quiz_question" VALUES(168,'Which HTTP method was not part of the HTTP/1.0 specification?','web-programming',3,'','The OPTIONS method was added in the HTTP/1.1 specification.',1,'2013-07-28 05:32:07.748117','2013-07-28 05:32:07.748129');
INSERT INTO "quiz_question" VALUES(169,'What is the difference between the GET and HEAD methods of the HTTP protocol?','web-programming',3,'','The response of a HEAD requests is a header identical to that of a GET request, but without a response body.',1,'2013-07-28 05:32:07.756811','2013-07-28 05:32:07.756823');
INSERT INTO "quiz_question" VALUES(170,'Which server response is not part of the HTTP standard?','web-programming',3,'','404 is part of the standard but it means something else: "Not Found"',1,'2013-07-28 05:32:07.766069','2013-07-28 05:32:07.766082');
INSERT INTO "quiz_question" VALUES(171,'Which type of error is indicated by a 4xx class of HTTP status code?','web-programming',3,'','Status codes in the class 4xx all indicate some kind of client error, such as requesting a non-existent page, or a syntax error in the request, just to name a few.',1,'2013-07-28 05:32:07.775410','2013-07-28 05:32:07.775423');
INSERT INTO "quiz_question" VALUES(172,'What can you do with HTTP POST that you cannot do with HTTP GET?','web-programming',3,'','Uploading a file requires enclosing an entity in the request, which is supported by a POST request but not by a GET request.',1,'2013-07-28 05:32:07.783490','2013-07-28 05:32:07.783504');
INSERT INTO "quiz_question" VALUES(173,'What was the limit of the header size in the HTTP/1.0 standard?','web-programming',3,'','The standard itself does not set a limit on the header size, but most implementations impose some limits for practical and security reasons.',1,'2013-07-28 05:32:07.793891','2013-07-28 05:32:07.793906');
INSERT INTO "quiz_question" VALUES(174,'How to delete a directory recursively in Windows?','windows',2,'','rmdir /s/q deletes the specified directory and all subdirectories. It is the equivalent of rm -fr in UNIX.',1,'2013-07-28 05:32:07.803305','2013-07-28 05:32:07.803326');
INSERT INTO "quiz_question" VALUES(175,'In Windows, how can you know what time the machine was started?','windows',2,'','The net statistics server command prints various interesting statistics about the running system, including the time it was started, similar to the uptime utility in UNIX.',1,'2013-07-28 05:32:07.812585','2013-07-28 05:32:07.812598');
INSERT INTO "quiz_question" VALUES(176,'How to map a network share to a drive letter in Windows?','windows',2,'','You can map a network share to a drive letter with net use. The first parameter is the drive letter followed by a colon, the second parameter is the path to the network share.',1,'2013-07-28 05:32:07.821878','2013-07-28 05:32:07.821891');
INSERT INTO "quiz_question" VALUES(177,'Which is not a standard environment variable in Windows?','windows',2,'','%cd% is the current working directory, %date% is the current date, %time% is the current time. %pwd% is not a standard environment variable in Windows.',1,'2013-07-28 05:32:07.829985','2013-07-28 05:32:07.829997');
INSERT INTO "quiz_question" VALUES(178,'What is the main function of the Domain Controller on a Microsoft Server?','windows',2,'','The main function of the Domain Controller is to handle user authentication requests.',1,'2013-07-28 05:32:07.838188','2013-07-28 05:32:07.838200');
INSERT INTO "quiz_question" VALUES(179,'Which was the first version of Microsoft Windows that enforced preemptive multitasking?','windows',3,'','Windows NT was the first version of Microsoft Windows which enforced preemptive multitasking. Earlier versions used cooperative multitasking.',1,'2013-07-28 05:32:07.846478','2013-07-28 05:32:07.846491');
